import React, { useEffect, useState } from "react"

const Landing = () => {
    const [responseAll, setResponseAll] = useState({title: null, subheading: null})
    const [loading, setLoading] = useState(true)

    useEffect(() => {
        const getData = async () => {
            const [responseTitle, responseSubheading] = await Promise.all([
                fetch("http://localhost:1337/api/main-title"), 
                fetch("http://localhost:1337/api/subheading")
            ])
            setResponseAll({
                title: await responseTitle.json(), 
                subheading: await responseSubheading.json()
            })
            setLoading(false)
        }
        getData()
    }, [])

    return (
        <>
            {
                loading ? 
                <p>Content is loading...</p> 
                :
                <div>
                    <h1>{responseAll.title.data.attributes.title}</h1> 
                    <h1>{responseAll.subheading.data.attributes.subheading}</h1>       
                </div>
            }
        </>
    )
}

export default Landing
